import React from 'react';
import { Box } from '@mui/material';

// Using the actual Dompé logo
const Logo = () => {
  return (
    <Box
      component="img"
      src="/images/dompe-logo.png"
      alt="Dompé Pharmaceuticals"
      sx={{
        width: 50,
        height: 50,
        objectFit: 'contain',
      }}
    />
  );
};

export default Logo;
